// const Clock = () => <h1> React is cool </h1>

class Clock extends React.Component {
    render() {
        const name = this.props.name;
        const { phrase } = this.props;
        return (
            <h1>React is cool, { name }!</h1>
        )
    }
}

export default Clock;
